import React, { Component } from 'react'
import PropTypes from 'prop-types';

class Gallery extends Component {

 

    render() {
        let imageList;
        const {images}=this.props
        if(images){
            imageList=(
                <div className="items">
                    {images.map(gal =>  <div className="item" key={gal.id} > <img src={gal.largeImageURL} /> </div> )} 
                </div>
            )
        } else{
            imageList=null;
        }

        return (

            {imageList}
            
        )
    }
}

Gallery.propTypes={
    images:PropTypes.array.isRequired
}

export default Gallery
